			return {
				/**
				 * The CSS classes
				 */		
				 
				classes: {
					active: 'flipclock-active',
					before: 'flipclock-before',
					flip: 'flip',
					play: 'play'
				},
					
				/**
				 * The last value selected in the list
				 */		
				 
				lastValue: 0
			};
